

let Stars = document.querySelectorAll(".StarsAll .starSec")
let jobId = document.querySelector(".StarsAll").getAttribute("data-job");

let loadingConn3 = document.querySelector(".loadingCon");

for (let i = Stars.length - 1; i >= 0; i--) {

    Stars[i].addEventListener("mouseover", () => {

        removeAllStarsActives();

        Stars[i].classList.add("scale")

        for (let x = Stars.length - 1; x >= i; x--) {

            Stars[x].classList.add("active")
        }
    });

    Stars[i].addEventListener("mouseout", () => {

        removeAllStarsActives()
    })

    Stars[i].addEventListener("click", () => {

        loadingConn3.classList.add("active")

        let ratePoint = 5 - i;

        let xml = new XMLHttpRequest();
        xml.onreadystatechange = function () {
            if (this.readyState == 4 && this.status == 200) {

                loadingConn3.classList.remove("active")

                let result = this.responseText.split("|");


                if (result.length == 1) {

                    Swal.fire({

                        icon: 'error',
                        title: result[0],
                        toast: true,
                        timer: 5000,
                        timerProgressBar: true,
                        customClass: {
                            container: 'swal2-toast',
                        }
                    })
                }
                else {

                    document.querySelector(".allRts .title").innerHTML = result[0];

                    setRateShapes(result[1]);


                    Swal.fire({

                        icon: 'success',
                        title: result[2],
                        toast: true,
                        timer: 5000,
                        timerProgressBar: true,
                        customClass: {
                            container: 'swal2-toast',
                        }
                    })

                }

            }

        }
        xml.open("GET", '/Job/' + jobId + '/Rate/' + ratePoint);
        xml.send()

    });
}


function removeAllStarsActives() {

    Stars.forEach(Stars => {

        Stars.classList.remove("active")
        Stars.classList.remove("scale")
    })
}

